import React from 'react';
import { MDBCard, MDBCardTitle, MDBBtn, MDBRow, MDBCol, MDBIcon } from 'mdbreact';
import Register from  './Register'
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
const CardExample = () => {
  return (
    <Router>

    <MDBRow>
      <MDBCol>
        <MDBCard src="Moto.jpg" className="card-image" style={{
              backgroundImage: "url('data:image/jpeg;base64,')"
            }}>
          <div className="text-white text-center d-flex align-items-center rgba-black-strong py-5 px-4">
            <div>
              <h5 className="red-text">
                <MDBIcon icon="motorcycle" /> Moto
              </h5>
              <MDBCardTitle tag="h3" className="pt-2">
                <strong>MAKE A TRANSPORT REQUEST</strong>
              </MDBCardTitle>
              <p>
              Press the button below to request a transportation request
                After filling out the form that will appear on your
                screen for us can know if our services are available
              </p>
              <MDBBtn color="red">
              <Link active to="/Register2" > <MDBIcon icon="motorcycle" /> make a request</Link>
              </MDBBtn>
            </div>
          </div>
        </MDBCard>
      </MDBCol>
      <MDBCol>
        <MDBCard className="card-image" style={{
              backgroundImage:
              "url('data:image/jpeg;base64,')"            }}>
          <div className="text-white text-center d-flex align-items-center rgba-indigo-strong py-5 px-4">
            <div>
              <h5 className="orange-text">
                <MDBIcon icon="car" /> Taxi
              </h5>
              <MDBCardTitle tag="h3" className="pt-2">
                <strong>MAKE A TRANSPORT REQUEST</strong>
              </MDBCardTitle>
              <p>
              Press the button below to request a transportation request
                After filling out the form that will appear on your
                screen for us can know if our services are available
              </p>
              <MDBBtn color="deep-orange">
              <Link active to="/Register" > <MDBIcon icon="car" /> make a request</Link>
              </MDBBtn> 
            </div>
          </div>
        </MDBCard>
      </MDBCol>
    </MDBRow>      
    </Router>

  )
}

export default CardExample;